import React from "react";
import { MDBContainer, MDBRow, MDBCol, MDBNavLink } from "mdbreact";
import { NavLink } from "react-router-dom";

import "./Home.css";

export default class Footer extends React.Component {
  render() {
    return (
      <div className="Footer">
        <MDBContainer className="grid">
          <MDBRow>
            <MDBCol>
              {" "}
              <i class="fas fa-phone fa-2x" />
              <h2>
                Telefon: <br />
                +49 1525 3205956
              </h2>
            </MDBCol>
            <MDBCol />
            <MDBCol>
              {" "}
              <i class="fab fa-instagram fa-2x">
                <a
                  href="https://www.instagram.com/weppeswein/"
                  className="NavLink"
                >
                  {" "}
                  Instagram
                </a>
              </i>
            </MDBCol>
          </MDBRow>
          <MDBRow className="Footer">
            <MDBCol>
              {" "}
              <i class="fas fa-envelope fa-2x">
                E-Mail Adresse: <br />
                <a href="mailto:hey@paxet.de">hey@paxet.de</a>
              </i>
            </MDBCol>
            <MDBCol>
              {" "}
              <a href="mailto:marcelwepper@gmail.com" className="NavLink">
                {" "}
                Mailen
              </a>
            </MDBCol>
            <MDBCol>
              {" "}
              <MDBNavLink to="/contact" className="NavLink">
                {" "}
                Datenschutzhinweis
              </MDBNavLink>
            </MDBCol>
          </MDBRow>
        </MDBContainer>
      </div>
    );
  }
}
